import React, { Component } from "react";

class FilterTodo extends Component {
  render() {
    return (
      <div>
        <select
          onChange={function() {
            if (target.value === "All") {
              console.log("hello");
            }
          }}
        >
          <option>All</option>
          <option value="Completed">Completed</option>
          <option value="Incompleted">Incompleted</option>
        </select>
      </div>
    );
  }
}

export default FilterTodo;
